__NUXT_JSONP__("/svet/mesto/franceville", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v){return {data:[{place:[{id:k,id_state:l,name:m,population:42976,area:237.7,altitude:418,slug:n,information_chatgpt:a,coordinates:[{latitude:-1.6345,longitude:13.5874}],biggest:"yes",type_place:b,id_image_cover:a,id_image_hero:a,affiliate:[{name:o,value:f}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:c,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2024-03-04T19:48:29.85915+00:00",name_original:a,setting_top:f,setting_status_public:h}],imagePlace:[],placeState:[{tld:".ga",name:"Gabon",area:267667,population:2225734,slug:p,id_continent:g,information_chatgpt:"\u003Cp\u003EGabon je země ležící v západní Africe, která se rozkládá na ploše 267 667 km² a má přibližně 2,2 milionu obyvatel. Hlavním městem je Libreville, které se nachází na pobřeží Atlantského oceánu a je hlavním centrem politického, ekonomického a kulturního života v zemi.\u003C\u002Fp\u003E\n\u003Cp\u003EGabon má mnoho přírodních krás, zahrnujících tropické deštné pralesy, divokou zvěř, pohoří a pláže. Národní park Loango je jednou z nejznámějších turistických atrakcí, která se rozkládá na pobřeží Atlantského oceánu. Je to jedno z nejvýznamnějších míst pro pozorování zvířat, jako jsou gorily, sloni, nosorožci, hroši a mnoho dalších druhů.\u003C\u002Fp\u003E\n\u003Cp\u003EGabonská kultura je různorodá a zahrnuje mnoho tradic a rituálů. Mezi nejvýznamnější patří masky a tance, které jsou součástí místních festivalů a slavností. Gabonská kuchyně je ovlivněna francouzskou kuchyní a zahrnuje mnoho mořských plodů, masa a zeleniny.\u003C\u002Fp\u003E\n\u003Cp\u003EEkonomika Gabonu je založena na těžbě ropy a dřeva. Země je také známá pro své umělecké řemeslo, jako jsou řezby v dřevě a malby na textilie. Gabon se snaží diverzifikovat svou ekonomiku a podporuje turistický průmysl a odvětví rybolovu.\u003C\u002Fp\u003E\n\u003Cp\u003EPro cestovatele se doporučuje vakcinace proti nemocem jako je malárie a žlutá zimnice, protože tyto nemoci jsou v zemi běžné. Dále je třeba dodržovat bezpečnostní opatření v důsledku možného výskytu kriminality a násilí. Nicméně, Gabon nabízí návštěvníkům jedinečnou příležitost prozkoumat krásy afrického kontinentu a poznat její kulturu a přírodní bohatství.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:600,date_update:d},{name:"Hlavní jídlo",value:8000,date_update:d},{name:"Chleba",value:300,date_update:d},{name:"Mléko",value:i,date_update:d},{name:"Voda (500ml)",value:400,date_update:d},{name:"Espresso",value:q,date_update:d},{name:"Zmrzlina (jeden kopeček)",value:i,date_update:d},{name:"Pivo",value:q,date_update:d},{name:"Krabička cigaret",value:2500,date_update:d},{name:"Big Mac",value:7000,date_update:d},{name:"Coca Cola (500ml)",value:i,date_update:d}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:e},{name:"Policie",value:"177",date_update:e},{name:"Hasiči",value:"18",date_update:e},{name:"Zdravotnická záchranná služba",value:"1300",date_update:e}],phone_prefix:"+241",coordinates:[{latitude:"-0.8037",longitude:"11.6094"}],people_religion:[{name:"Křesťanství",value:"88.7%"},{name:"Animismus",value:"6.6%"},{name:"Islám",value:"2%"},{name:"Bez vyznání",value:"1.1%"},{name:"Judaismus",value:r},{name:"Baha'i",value:r},{name:"Jiné náboženství",value:"1.4%"}],people_nationality:[{name:"Fang",value:"32%"},{name:"Bapounou\u002FEschira",value:"15%"},{name:"Mbédé",value:"14%"},{name:"Myènè",value:"10%"},{name:"Teke",value:"7%"},{name:"Punu",value:"6%"},{name:"Nzebi",value:"5%"},{name:"Obamba",value:"3%"},{name:"Other",value:"8%"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz nestačí pro vstup do Gabonu. Je potřeba mít platný cestovní pas.",date_update:e},{name:"Cestovní pas",value:"Pro vstup do Gabonu je nezbytné mít platný cestovní pas.",date_update:e},{name:"Vízum",value:"Pro vstup do Gabonu je pro většinu cizinců potřeba mít vízum. Občané Evropské unie však mohou být osvobozeni od vízové povinnosti pro pobyt do 90 dnů. Pro delší pobyt je potřeba vízum.",date_update:e},{name:"Očkování",value:"Při vstupu do Gabonu nejsou vyžadována žádná specifická očkování. Nicméně doporučuje se být očkován proti žluté zimnici, malárii a hepatitidě A a B. Před cestou je vhodné konzultovat očkování s lékařem.",date_update:e},{name:"Cestovní pojištění",value:"Při vstupu do Gabonu není vyžadováno cestovní ani zdravotní pojištění. Nicméně doporučuje se mít sjednané komplexní cestovní pojištění, které pokryje zdravotní a majetkové rizika během pobytu v zemi.",date_update:e},{name:"Bezpečností situace",value:"V Gabonu platí obecně mírná kriminalita, avšak turisté jsou občas vystaveni drobným krádežím a loupežím. Je také třeba dbát opatrnosti vůči demonstracím a politickým nepokojům. Vzhledem k vysoké míře kriminality a nebezpečí teroristických útoků je doporučováno vyhýbat se cestování do oblasti hranic s Kamerunem a Kongem.",date_update:e},{name:"Další informace",value:"V Gabonu je dobré dbát na zvyklosti a dodržovat základní pravidla slušného chování. Doporučuje se mít u sebe dostatek hotovosti, neboť v mnoha oblastech nejsou dostupné bankomaty ani kreditní karty. Při cestování mimo města a turisticky atraktivní oblasti je nutné dbát na zásoby vody a potravin, a to i v případě, že se jedná o krátkodobý výlet. Před cestou je vhodné prověřit si aktuální informace o místní situaci a povinnostech vůči tamním úřadům.",date_update:e}],type_place:s,id_image_cover:j,id_image_hero:j,id_city_main:t,affiliate:[{name:o,value:f}],mpz:"GA",alerts:[],zoom:[{google:6,booking:7}],ids_neighboring_countries:[{id:47},{id:42},{id:88}],organization:[],apps:[],links:[],information_author:[],seo_tags:[],language_phrases:[],wall_sockets:a,id:l,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:a,currency:[{code:"XAF",name:"CFA frank"}],setting_top:f,setting_status_public:h}],imageState:[{id:j,name:p,source:"\u002Fworld\u002Fstates\u002F",type:s,author:"pixabay.com",created_at:"2023-05-02T18:49:47.851894+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:g,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:g,id_image_hero:g,zoom:[{google:2,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:u,date_update:u,author_create:v,author_update:v}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Africa",setting_top:f,setting_status_public:h}],placesCities:[{id:k,id_image_cover:a,importance:c,slug:n,type_place:b,name:m},{id:736,id_image_cover:a,importance:c,slug:"koulamoutou",type_place:b,name:"Koulamoutou"},{id:734,id_image_cover:a,importance:c,slug:"lambarene",type_place:b,name:"Lambaréné"},{id:t,id_image_cover:a,importance:c,slug:"libreville",type_place:b,name:"Libreville"},{id:737,id_image_cover:a,importance:c,slug:"makokou",type_place:b,name:"Makokou"},{id:732,id_image_cover:a,importance:c,slug:"moanda",type_place:b,name:"Moanda"},{id:733,id_image_cover:a,importance:c,slug:"mouila",type_place:b,name:"Mouila"},{id:731,id_image_cover:a,importance:c,slug:"oyem",type_place:b,name:"Oyem"},{id:729,id_image_cover:a,importance:c,slug:"port-gentil",type_place:b,name:"Port-Gentil"},{id:735,id_image_cover:a,importance:c,slug:"tchibanga",type_place:b,name:"Tchibanga"}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarEventComponent:0":{events:[],images:a}},mutations:[]}}(null,"city","biggest","09-2021","05-2023",true,5,1,1000,251,730,76,"Franceville","franceville","booking","gabon",1500,"0.1%","state",728,"2024-03-01","1")));